import Vue from 'vue'
import App from './App.vue'
import router from './router'

import'mint-ui/lib/style.css'

   //1.1完成引入所有组件
   import MintUI from "mint-ui"
   //1.2  单引入mint-ui样式文件
   import "mint-ui/lib/style.css"
   //1.3  将mint-ui注册vue
   //挑组件库中组件添加自定义组建
   Vue.use(MintUI)
   import  "./font/iconfont.css"
  

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
